import React from "react";
import Trial from "./components/Trial";

class App extends React.Component{
  render(){
    return(
      <div> 
        <Trial title="Hello Mokleters" bdColor="danger"
        subtitle="Infinity Never Surrender" />

        <Trial title="Hello Panda"
        subtitle="Infinity Gose to Success" />
      </div>
    )
  }
}

export default App;
